    constructor(fb, http, router, apiService, authService, utilService, translate, notifyService, validationService, dialogRef) {
        this.fb = fb;
        this.http = http;
        this.router = router;
        this.apiService = apiService;
        this.authService = authService;
        this.utilService = utilService;
        this.translate = translate;
        this.notifyService = notifyService;
        this.validationService = validationService;
        this.dialogRef = dialogRef;
        this.id = 0;
        this.cityList1 = [];
        this.cityList2 = [];
        this.categoryCodeControl = new FormControl('', Validators.required);
        this.salesTermsCodeControl = new FormControl('', Validators.required);
        this.userTypes = [];
        this.custARAcControl = new FormControl('', Validators.required);
        this.custArAcCodeControl = new FormControl('', Validators.required);
        this.custDefExpAcCodeControl = new FormControl('', Validators.required);
        this.custARAdjAcCodeControl = new FormControl('', Validators.required);
        this.custARDiscAcCodeControl = new FormControl('', Validators.required);
        this.readonly = "";
        this.isDataLoading = false;
        this.filteredCategoryCodes = this.categoryCodeControl.valueChanges.pipe(startWith(''), debounceTime(utilService.autoDelay()), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isDataLoading = true;
            return this.filterCategoryCodes(val || '');
        }));
        this.filteredSalesTermsCodes = this.salesTermsCodeControl.valueChanges.pipe(startWith(''), debounceTime(utilService.autoDelay()), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isDataLoading = true;
            return this.filterSalesTermsCodes(val || '');
        }));
        this.filteredcustARAc = this.custARAcControl.valueChanges.pipe(startWith(''), debounceTime(utilService.autoDelay()), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isDataLoading = true;
            return this.filterAccountCodes(val || '');
        }));
        this.filteredcustArAcCode = this.custArAcCodeControl.valueChanges.pipe(startWith(''), debounceTime(utilService.autoDelay()), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isDataLoading = true;
            return this.filterAccountCodes(val || '');
        }));
        this.filteredcustDefExpAcCode = this.custDefExpAcCodeControl.valueChanges.pipe(startWith(''), debounceTime(utilService.autoDelay()), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isDataLoading = true;
            return this.filterAccountCodes(val || '');
        }));
        this.filteredcustARAdjAcCode = this.custARAdjAcCodeControl.valueChanges.pipe(startWith(''), debounceTime(utilService.autoDelay()), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isDataLoading = true;
            return this.filterAccountCodes(val || '');
        }));
        this.filteredcustARDiscAcCode = this.custARDiscAcCodeControl.valueChanges.pipe(startWith(''), debounceTime(utilService.autoDelay()), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isDataLoading = true;
            return this.filterAccountCodes(val || '');
        }));
    }
    ngOnInit() {
        this.setForm();
        this.loadCities();
        if (this.id > 0) {
            this.readonly = "readonly";
            this.setEditForm();
        }
    }
    closeModel() {
        this.dialogRef.close();
    }
    setForm() {
        //let cDate: IMyDateModel = { isRange: false, singleDate: {}, dateRange: null };
        this.form = this.fb.group({
            //'': ['', Validators.required],
            //   'stateone': [''],
            //   'countryone': [''],
            //   'statetwo': [''],
            //   'countrytwo': [''],
            'vendCode': ['', Validators.required],
            'vendName': ['', Validators.required],
            'vendArbName': ['', Validators.required],
            'vendAlias': ['', Validators.required],
            //   'vendType': ['',Validators.required],
            'vatNumber': ['', Validators.required],
            'vendRating': ['', Validators.required],
            'vendDiscount': ['', Validators.required],
            'vendCrLimit': ['', Validators.required],
            'vendPoRep': ['', Validators.required],
            'vendPoArea': ['', Validators.required],
            'vendARAc': [''],
            'vendLastPaidDate': ['', Validators.required],
            'vendLastPoDate': ['', Validators.required],
            'vendLastPayAmt': ['', Validators.required],
            'vendAddress1': ['', Validators.required],
            //   'vendCityId1': [''],
            'vendMobile1': ['', Validators.compose([Validators.required, this.validationService.mobileValidator])],
            'vendPhone1': ['', Validators.compose([Validators.required, this.validationService.mobileValidator])],
            'vendEmail1': ['', Validators.compose([Validators.required, Validators.email])],
            'vendContact1': ['', Validators.compose([Validators.required])],
            'vendAddress2': ['', Validators.required],
            //   'vendCityId2': [''],
            'vendMobile2': ['', Validators.compose([Validators.required, this.validationService.mobileValidator])],
            'vendPhone2': ['', Validators.compose([Validators.required, this.validationService.mobileValidator])],
            'vendEmail2': ['', Validators.compose([Validators.required, Validators.email])],
            'vendContact2': ['', Validators.compose([Validators.required])],
            //   'vendUDF1': [''],
            //   'vendUDF2': [''],
            //   'vendUDF3': [''],
            //   'vendAllowCrsale': [false],
            //   'vendAlloCrOverride': [false],
            //   'vendOnHold': [false],
            //   'vendAlloChkPay': [false],
            //   'vendSetPriceLevel': [false],
            //   'vendIsVendor': [false],
            //   'vendArAcBranch': [false],
            //   'vendArAcCode': ['', Validators.required],
            //   'vendDefExpAcCode': ['',Validators.required],
            //   'vendARAdjAcCode': ['',Validators.required],
            //   'vendARDiscAcCode': ['',Validators.required],
            //   'vendCatCode': [''],
            //   'poTermsCode': [''],
            //   'vendCityCode1': [''],
            //   'vendCityCode2': [''],
            'isActive': [true],
            //   'vendOutStandBal': [''],
            //   'vendAvailCrLimit': [''],
            'stateone': [''],
            'countryone': [''],
            'statetwo': [''],
            'countrytwo': [''],
            //   'vendCode': [''],
            //  'vendName': [''],
            //  'vendArbName': [''],
            // 'vendAlias': [''],
            // 'vendRating': [''],
            'vendType': ['', Validators.required],
            'vendCatCode': [''],
            'poTermsCode': [''],
            // 'vendDiscount': [''],
            // 'vendCrLimit': [''],
            // 'vendPoRep': [''],
            //'vendPoArea': [''],
            //'vendARAc': [''],
            //'vendLastPaidDate': [''],
            //'vendLastPoDate': [''],
            //'vendLastPayAmt': [''],
            // 'vendAddress1': [''],
            'vendCityCode1': ['', Validators.required],
            //'vendMobile1': [''],
            //'vendPhone1': [''],
            //'vendEmail1': [''],
            //'vendContact1': [''],
            //'vendAddress2': [''],
            'vendCityCode2': ['', Validators.required],
            //'vendMobile2': [''],
            //'vendPhone2': [''],
            //'vendEmail2': [''],
            //'vendContact2': [''],
            'vendUDF1': [''],
            'vendUDF2': [''],
            'vendUDF3': [''],
            //'isActive': [true],
            'vendAllowCrsale': [false],
            'vendAlloCrOverride': [false],
            'vendOnHold': [false],
            'vendAlloChkPay': [false],
            'vendSetPriceLevel': [false],
            //'vendPriceLevel': [100],
            'vendIsVendor': [false],
            'vendArAcBranch': [false],
            'vendArAcCode': [''],
            'vendDefExpAcCode': [''],
            'vendARAdjAcCode': [''],
            'vendARDiscAcCode': [''],
            'vendOutStandBal': [0],
            'vendAvailCrLimit': ['']
        });
    }
    submit() {
        if (this.id > 0)
            this.form.value['id'] = this.id;
        let custCatCode = this.categoryCodeControl.value;
        let salesTermsCode = this.salesTermsCodeControl.value;
        let custARAc = this.custARAcControl.value;
        let custARDiscAcCode = this.custARDiscAcCodeControl.value;
        let custDefExpAcCode = this.custDefExpAcCodeControl.value;
        let custARAdjAcCode = this.custARAdjAcCodeControl.value;
        let custArAcCode = this.custArAcCodeControl.value;
        if (this.utilService.hasValue(custCatCode)) {
            this.form.value['vendCatCode'] = this.utilService.removeSqueres(custCatCode);
            this.categoryCodeControl.setValue(custCatCode);
        }
        else {
            console.log("vendCatCode-");
        }
        if (this.utilService.hasValue(salesTermsCode)) {
            this.form.value['poTermsCode'] = this.utilService.removeSqueres(salesTermsCode);
            this.salesTermsCodeControl.setValue(salesTermsCode);
        }
        else {
            console.log("poTermsCode-");
        }
        if (this.utilService.hasValue(custARAc)) {
            this.form.value['vendARAc'] = this.utilService.removeSqueres(custARAc);
            this.custARAcControl.setValue(custARAc);
        }
        else {
            console.log("vendARAc-");
        }
        if (this.utilService.hasValue(custArAcCode)) {
            this.form.value['vendArAcCode'] = this.utilService.removeSqueres(custArAcCode);
            this.custArAcCodeControl.setValue(custArAcCode);
        }
        else {
            console.log("vendArAcCode-");
        }
        if (this.utilService.hasValue(custDefExpAcCode)) {
            this.form.value['vendDefExpAcCode'] = this.utilService.removeSqueres(custDefExpAcCode);
            this.custDefExpAcCodeControl.setValue(custDefExpAcCode);
        }
        else {
            console.log("custDefExpAcCode-");
        }
        if (this.utilService.hasValue(custARAdjAcCode)) {
            this.form.value['vendARAdjAcCode'] = this.utilService.removeSqueres(custARAdjAcCode);
            this.custARAdjAcCodeControl.setValue(custARAdjAcCode);
        }
        else {
            console.log("custARAdjAcCode-");
        }
        if (this.utilService.hasValue(custARDiscAcCode)) {
            this.form.value['vendARDiscAcCode'] = this.utilService.removeSqueres(custARDiscAcCode);
            this.custARDiscAcCodeControl.setValue(custARDiscAcCode);
        }
        else {
            console.log("custARDiscAcCode-");
        }
        if (this.form.valid) {
            if (!this.utilService.hasValue(custARDiscAcCode) && !this.utilService.hasValue(custDefExpAcCode)
                && !this.utilService.hasValue(custARAdjAcCode) && !this.utilService.hasValue(custArAcCode)) {
                this.notifyService.showError('Select Account Mapping');
                return;
            }
            this.apiService.post('vendorMaster', this.form.value)
                .subscribe(res => {
                this.utilService.OkMessage();
                // this.reset();
                this.dialogRef.close(true);
            }, error => {
                console.error(error);
                this.utilService.ShowApiErrorMessage(error);
            });
        }
        else
            this.utilService.FillUpFields();
    }
    setEditForm() {
        this.apiService.get('vendorMaster', this.id).subscribe(res => {
            if (res) {
                this.categoryCodeControl.setValue(res['vendCatCode']);
                this.salesTermsCodeControl.setValue(res['poTermsCode']);
                this.custARAcControl.setValue(res['vendARAc']);
                this.custDefExpAcCodeControl.setValue(res['vendDefExpAcCode']);
                this.custARAdjAcCodeControl.setValue(res['vendARAdjAcCode']);
                this.custArAcCodeControl.setValue(res['vendArAcCode']);
                this.custARDiscAcCodeControl.setValue(res['vendARDiscAcCode']);
                this.form.patchValue(res);
                this.apiService.getall('City/getStateCountrybyCityCode/' + res['vendCityCode1']).subscribe(res => {
                    this.form.patchValue({ 'stateone': res['stateName'], 'countryone': res['countryName'] });
                });
                this.apiService.getall('City/getStateCountrybyCityCode/' + res['vendCityCode2']).subscribe(res => {
                    this.form.patchValue({ 'statetwo': res['stateName'], 'countrytwo': res['countryName'] });
                });
                this.form.patchValue({ 'id': 0 });
            }
        });
    }
    loadCities() {
        this.apiService.getall('City/getCitiesSelectList').subscribe(res => {
            this.cityList1 = res;
            this.cityList2 = res;
        });
        this.apiService.getall('userType/getUserTypeSelectList').subscribe(res => {
            this.userTypes = res;
        });
    }
    getStateCountrybyCityCode1(event) {
        const id = event.target.value;
        this.apiService.getall('City/getStateCountrybyCityCode/' + id).subscribe(res => {
            this.form.patchValue({ 'vendCityCode1': res['cityCode'], 'stateone': res['stateName'], 'countryone': res['countryName'] });
        });
    }
    getStateCountrybyCityCode2(event) {
        const id = event.target.value;
        this.apiService.getall('City/getStateCountrybyCityCode/' + id).subscribe(res => {
            this.form.patchValue({ 'vendCityCode2': res['cityCode'], 'statetwo': res['stateName'], 'countrytwo': res['countryName'] });
        });
    }
    reset() {
        this.form.controls['vendName'].setValue('');
    }
    filterCategoryCodes(val) {
        return this.apiService.getall(`vendorCategory/getSelectVendorCategoryCodeList?search=${val}`)
            .pipe(map(response => {
            const res = response;
            this.isDataLoading = false;
            /* if (res.length == 0) { this.categoryCodeControl.setValue('');}*/
            return res;
        }));
    }
    filterSalesTermsCodes(val) {
        return this.apiService.getall(`poTermsCode/getSelectPoTermsCodeList?search=${val}`)
            .pipe(map(response => {
            const res = response;
            this.isDataLoading = false;
            return res;
        }));
    }
    filterAccountCodes(val) {
        return this.apiService.getall(`mainAccounts/getSelectMainAccountList?search=${val}`)
            .pipe(map(response => {
            const res = response;
            this.isDataLoading = false;
            return res;
        }));
    }
    validate(event, control, action) {
        let value = '';
        if (action == "change") {
            value = event.target.value;
        }
        switch (control) {
